import React from 'react';
export default class RenderRows extends React.Component {
    constructor(props) {
        this.state = {
            customer: {
                date: this.props.dataFromApp.dat,
                name: this.props.dataFromApp.date,
                time: this.props.dataFromApp.time
            }
        }
    }
    render() {
        return (
            <tr>
                <td>{this.customer.date}</td>
                <td>{this.props.dataFromApp.name}</td>
                <td>{this.props.dataFromApp.time}</td>
            </tr>
        );
    }
}
